import React from "react";
import QrCode from "../components/QrScanner";

function Scanner() {
  return (
    <>
      <div className="container mt-3">
        <div className="row">
          <div className="col-12">
            <QrCode />
          </div>
        </div>
      </div>
    </>
  );
}

export default Scanner;
